import React from 'react';
/***************************************************************/

export function Symbol(props) {
    let classValue = "ms ms-" + props.symbol
    let font = props.fontSize

    if (!props.symbolOnly) {
        classValue = classValue + " ms-cost"
    }
    
    if (props.shadow) {
        classValue = classValue + " ms-shadow"
    }

    return (
        <i fontSize={font} class={classValue}/>
    );
}
